--Create table "Product".
CREATE TABLE "Products" ("ID" INTEGER NOT NULL, "Name" TEXT NOT NULL, "ScanCode" TEXT, "Cost" REAL NOT NULL, "Price" REAL NOT NULL, "ImageURL" TEXT, "DateCreated" TEXT NOT NULL, "DateUpdated" TEXT, "DateDeleted" TEXT);

--Create table "Address".
CREATE TABLE "Addresses" ("ID" INTEGER NOT NULL, "Line1" TEXT NOT NULL, "Line2" TEXT, "City" TEXT, "PostalCode" TEXT, "StateProvince" TEXT, "Country" TEXT, "Latitude" REAL, "Longitude" REAL);

--Create table "Customer".
CREATE TABLE "Customers" ("ID" INTEGER NOT NULL, "FirstName" TEXT NOT NULL, "LastName" TEXT NOT NULL, "Suffix" TEXT, "CompanyName" TEXT, "Title" TEXT, "Notes" TEXT, "AccountNumber" REAL, "Photo" BLOB, "DateCreated" TEXT NOT NULL, "DateUpdated" TEXT, "DateDeleted" TEXT);

--Create table "Order".
CREATE TABLE "Orders" ("ID" INTEGER NOT NULL, "CustomerID" INTEGER NOT NULL, "AddressID" INTEGER NOT NULL, "Status" TEXT NOT NULL, "PaymentMethod" TEXT, "Weight" REAL, "Shipped" INTEGER, "TrackingNumber" TEXT, "DateShipped" TEXT, "TimeShipped" TEXT);

--Create table "OrderProduct".
CREATE TABLE "OrderProducts" ("OrderID" INTEGER NOT NULL, "ProductID" INTEGER NOT NULL, "Quantity" INTEGER NOT NULL, "UnitCost" REAL NOT NULL, "UnitPrice" REAL NOT NULL, "TotalCost" REAL NOT NULL, "TotalPrice" REAL NOT NULL);

--Create table "Role".
CREATE TABLE "Roles" ("ID" INTEGER NOT NULL, "Name" TEXT NOT NULL);

--Create table "User".
CREATE TABLE "Users" ("ID" INTEGER NOT NULL, "RoleID" INTEGER NOT NULL, "UserName" TEXT NOT NULL, "Password" TEXT NOT NULL, "DateCreated" TEXT NOT NULL, "DateUpdated" TEXT, "DateDeleted" TEXT);

--Create table "Theme".
CREATE TABLE "Themes" ("ID" INTEGER NOT NULL, "Name" TEXT NOT NULL, "HexCode" TEXT NOT NULL);

